import './Expenses.css'
import ExpenseItem from './ExpenseItem'
import Card from '../UI/Card'

const Expenses = (props) => {

    return (
        <div>
            <ExpensesFilter/>
            <Card className='expenses'>
                {props.data.length > 0 && props.data
                .map(ei => <ExpenseItem
                id={ei.id}
                title={ei.title}
                amount={ei.amount}
                date={ei.date} />)
                }    
            </Card>
        </div>
    )
}

export default Expenses
